import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import { Navigation } from "swiper";
import ProductCard from "./ProductCard";
import "./ProductList.css";

const ProductList = () => {
  const products = [
    {
      img: "img/tovar/Iphone16Pro.jpeg",
      model: "Смартфон Apple iPhone 14 128GB",
      oldPrice: "888",
      newPrice: "777",
      availability: "В наличии",
    },
    {
      img: "img/tovar/iphon12.jpg",
      model: "Смартфон Samsung Galaxy S23 256GB",
      oldPrice: "999",
      newPrice: "888",
      availability: "Нет в наличии",
    },
    {
      img: "img/tovar/iphone13.jpg",
      model: "Планшет Apple iPad Pro 128GB",
      newPrice: "59 999",
      availability: "В наличии",
    },
    // Добавьте больше товаров...
  ];

  return (
    <Swiper
      modules={[Navigation]}
      navigation
      spaceBetween={20}
      slidesPerView={3}
      className="product-swiper"
    >
      {products.map((product, index) => (
        <SwiperSlide key={index}>
          <ProductCard
            img={product.img}
            model={product.model}
            oldPrice={product.oldPrice}
            newPrice={product.newPrice}
            availability={product.availability}
          />
        </SwiperSlide>
      ))}
    </Swiper>
  );
};

export default ProductList;
